import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

import Article from '../components/Article';
import Header from '../components/Header';

export default class QuestPage extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            articleList: [],
            title: props.title
        }
    }

    loadArticles() {
        for (var i = 0; i < this.state.articleList.length(); i++) {
            return (
                <Article />
            );
        }
    }

    render() {
        return (
            <div>
                <Header />
                <Container>
                    <Row>
                        <Col>
                            {this.loadArticles}
                        </Col>
                    </Row>

                </Container>
            </div>
        );
    }
}
